// Styles
import '@mdi/font/css/materialdesignicons.css'
import 'vuetify/styles'

// Vuetify
import { createVuetify } from 'vuetify'

const myTheme = {
    dark: true,
    colors:{
        primary: '#3f51b5',
        secondary: '#b0bec5',
        accent: '#8c9eff',
        error: '#b71c1c',
        background: '#440015',
        surface: '#1e1e1e',
        info: '#2196f3',
        success: '#4caf50',
        warning: '#ffeb3b',
        textlight: '#ffffff',
        textdark: '#000000',
    }
}
export default createVuetify({
    theme: {
        defaultTheme: 'myTheme',
        themes: {
            myTheme,
        }
    }
})
